import React, { useState, useEffect } from "react";

const Calculator = () => {
  const height = 0;
  const weight = 0;

  useEffect(() => {
    console.log("change");
  }, [height, weight]);
  //
  const [text, setText] = useState();
  //

  return (
    <>
      <div className="inputs">
        <input
          placeholder="身高"
          onChange={(e) => {
            setText(e.target.value);
          }}
        />
        <br />
        <input placeholder="體重" />
      </div>
    </>
  );
};
export default Calculator;
